import React from "react";

const NameField = () => {
  return (
    <div>
      <h3>First Name</h3>
      <input type="text" />
      <h3>Middle Name</h3>
      <input type="text" />
      <h3>Last Name</h3>
      <input type="text" />
    </div>
  );
};

export default NameField;
